class GameApi {
  static getAllGames() {
    return new Promise((resolve, reject) => {
      setTimeout(() => {
        resolve(Object.assign([], games));
        resolve(Object.assign([], games.map((game) => {
          game.creationDate = new Date(game.creationDate);
          game.retrieveDate = new Date();
          return game;
        })));
      }, delay);
    });
  }
  static getGame(id) {
    return new Promise((resolve, reject) => {
      setTimeout(() => {
        const focus = games.filter((item) => item.id === id);
        if(focus.length === 1) {
          resolve(Object.assign({}, focus[0]));
        } else {
          resolve({});
        }
      }, delay);
    });
  }
}

export default GameApi;
